const Modal = (props) =>{
    return (
        <>
            <div className="modal">
                <p>Did you complete this task?</p>
                <button onClick={() => props.dismissModal()
                } className="btn btn-highlight">Cancel
                </button>
                <button onClick={() => props.dismissModal()
                } className="btn">Confirm
                </button>
            </div>
            <div onClick={() => props.dismissModal()
            } className="backdrop"></div>
        </>
    );
};

export default Modal
